object.script:
-- this script shows the RPM cyan={42,252,90,(42)/10,(102)/10,(90)/10} red={150,25,24,10,5,4} pink={253,43,218,10,4,9} white={150,150,150,10,10,10} blue={42,252,218,4,4,11} yellow={225,253,44,23,26,0} t=0
function onTick() theme=input.getNumber(1) spd =input.getNumber(2) rps =input.getNumber(3) lvl =input.getNumber(4) cap =input.getNumber(5) bat =input.getNumber(6) mxspd=input.getNumber(7) mxrps=input.getNumber(8) x =input.getNumber(9) gear =math.floor(input.getNumber(11)+0.5)
on =input.getBool(1) blink=input.getBool(2) mulR =input.getBool(5) mulD =input.getBool(6) fix =input.getBool(8) and 1 or 0 if on then t=math.min(t+1,100) else t=math.max(t-2,0) end c=t/100 if theme==0 then dig=cyan elseif theme==1 then dig=red elseif theme==2 then dig=pink elseif theme==3 then dig=white elseif theme==4 then dig=blue else dig=yellow end end
function onDraw() w = screen.getWidth() h = screen.getHeight() screen.setColor(0,0,0) screen.drawClear()
screen.setColor(dig[4],dig[5],dig[6]) --bg screen.drawRectF(1,1+x+fix,29,17)
screen.setColor(dig[1],dig[2],dig[3],c*255) --fg
for i=0,math.min(26,math.floor(rps/mxrps*26+0.5)),1 do screen.drawRectF(2+i,math.max(2,8-i)+x+fix,1,1) end strng = math.floor(rps*60+0.5) len = string.len(strng) screen.drawText(30-len*5,4+x,strng)
gearD=gear>0 and mulD and gear or gear>0 and "D" or mulR and gear<0 and ("R"..math.abs(gear)) or gear<0 and "R"or "N" screen.drawRectF(2,10+x+fix,1,7) screen.drawText(4,11+x,gearD) screen.drawLine(0,h-1,w,h-1)
screen.setColor(dig[1]/4,dig[2]/4,dig[3]/4,c*255) --fg sec. for i=0,3-len,1 do screen.drawText(10+i*5,4+x,"0") end screen.drawText(15,rps,"rps") --screen.drawText(15,11+x,"rpm")
end
